The Men’s team event at World Fitasc 2023 will be one that we will remember for a while. @a.i.m.shooting , @zkienbaum & @domcgrossi and myself had to make up 12 targets today as a team and we did. We came back and tied France, which happened vice versa back in 2014. France got the gold then and we ended up taking gold this year. Pretty cool. 

Huge congrats to @georgehdigweed on winning yet another world championship individually. @gaelpoinsot podiumed again and the US is super proud of @nicolasberry for finishing 3rd. Congrats to @_toddhitch on winning Jr, @cadefaetche and @joseph_fanizzi on the Jr team for dominating, @haylynhanks on winning ladies and our US girls for winning the team category as well. 

Huge shout out to @tamas_jeri for throwing incredible targets and a spectacular venue! Fitasc, we’ll see you next year in the US.

